// Prototypes
// var arr = [1, 2, 3];
// arr.__proto__
// __proto__ references prototype methods of that class
// Certain members that are on all instances of a class
// Can be overwritten
// Array.prototype.pop = function() { /*code here*/ };

// __proto__ and .prototype are similar
// prototype - Actual object where members are added. Template object. Use this on class.
// __proto__ - Reference to the actual prototype object. Use on object.
//      - Rare you would need to access __proto__. Usually use prototype.